import {Nav,
        NavItem
            } from './style';

class Download extends PureComponent{
    render(){
        return (
            <Nav>
                <NavItem>1</NavItem>
                <NavItem>2</NavItem>
                <NavItem>3</NavItem>
                <button className="btn" >value="打底裤萨达哈萨克汇顶科技爱上的空间哈速度快哈萨克倒计时科技爱上的空间哈速度快哈萨克倒计时科技爱上的空间哈速度快哈萨dsdsdsdsds克倒计时"</button>
            </Nav>
        )
    }
}

export default Download;
